import Link from "next/link";

const Index = () => (
  <div>
    <Link href="/index">
      <a>Home</a>
    </Link>{" "}
    &nbsp;
    <Link href="/about">
      <a>About Page</a>
    </Link>{" "}
    &nbsp;
    <Link href="/admin/index">
      <a>Dashboard</a>
    </Link>{" "}
    &nbsp;
    <p>Hello Next.js</p>
  </div>
);

export default Index;
